import React from 'react';
import { View } from 'react-native';

import { Container } from './styles';

interface Props {
    children: any //might be array or single element, therefore no reactNode
}

export function ListContainer({ children }: Props) {
  return (
    <Container>
        {children}
    </Container>
  );
}
